import React from 'react-native'
import {HeaderV, HeaderLabel, Container} from './styles';

type Props = {
    title: string;
}

export function Header({title}: Props){

    return(
        <Container>
        <HeaderV>
            <HeaderLabel> {title} </HeaderLabel> 
        </HeaderV>
        </Container>
    );
}
